                  coding, or pushing pixels, you'll find me hanging out with
                  friends, working out, or binge-watching on Netflix.
                  <br />
                  <br />
                  <br />
                </p>
              </div>
              <div className="col-md-4 order-1 order-lg-2 home-img ">
                <img
                  src={web}
                  className="image-fluid animated img"
                  alt="CommonParent img"
                />
              </div>
            </div>
          </div>
